const Prediction = () =>{

    return (
<section>
<div class="about">

            <div class="about_us_img">
              <img src="img/top_service.png" alt="" />
            </div>
            <div class="about_us_text">
              <h2>About us</h2>
              <p>
                We are a group of students who developed this software to tackle
                Parkinson's. A little background: One of our team member's
                grandfather has Parkinson's, but doctors cannot diagnose him definitively because the most common methods
                are only 53% accurate. After
                doing extensive research we found that there are 22 features in a
                patient's voice that help detect the onset of Parkinson's. Our algorithm uses a neural network to processes
                those features and make a prediction of whether or not the patient has Parkinson's. Our test set accuracy is 92%.
              </p>
              <a class="btn_2 " href="#">learn more</a>
            </div>
      </div>
        </section>
    );
  };

  export default Prediction;
